import { Container, Box, Typography } from "@mui/material";

const TempContainer = ({ variant, temp }) => {
  return (
    <Box
      sx={{
        background: "linear-gradient(135deg, #ffecd2 0%, #fcb69f 100%)",
        borderRadius: 3,
        boxShadow: 2,
        p: 3,
        mb: 2,
        width: "100%",
        maxWidth: 400,
        mx: "auto",
      }}
    >
      <Container
        sx={{
          textAlign: "center",
          p: 0,
        }}
        maxWidth={false}
        disableGutters
      >
        <Typography
          variant={variant}
          sx={{
            fontSize: { xs: "1.1rem", sm: "1.3rem", md: "1.5rem" },
            color: "#333",
            mb: 1,
            overflow: "hidden",
            textOverflow: "ellipsis",
            whiteSpace: "nowrap",
          }}
        >
          <Box component="span" sx={{ fontWeight: "bold", color: "#c94b4b" }}>
            Current Temperature:&nbsp;
          </Box>
          {temp.feels_like} °C
        </Typography>
        <Typography
          variant={variant}
          sx={{
            fontSize: { xs: "1.1rem", sm: "1.3rem", md: "1.5rem" },
            color: "#333",
            overflow: "hidden",
            textOverflow: "ellipsis",
            whiteSpace: "nowrap",
          }}
        >
          <Box component="span" sx={{ fontWeight: "bold", color: "#c94b4b" }}>
            Humidity:&nbsp;
          </Box>
          {temp.humidity} %
        </Typography>
      </Container>
    </Box>
  );
};

export default TempContainer;
